import ProfileIndexMenu from './profileIndexMenu';
import ProfileListContent from './profileListContent';
import SimpleBarReact from 'simplebar-react';

// Extends ProfileList //
export default function ProfileListContainer(props) {
  const listContainer = listName => {
    return (
      <div>
        <ProfileIndexMenu 
            profileDataToRender = {props.profileDataToRender[listName.toLowerCase()]}
            style               = {props.style}/>

        <ProfileListContent 
            style={props.style}
            profileDataToRender={props.profileDataToRender[listName.toLowerCase()]}
            totalToRenderNumber={props.totalToRenderNumber}
            setFocused={props.setFocused}/>
      </div>
    )
  }

  // Adds space between list for readability //
  //// Need to add filter to remove spacer for profiles with nothing to render ////
  function renderListContainer(listName, i) {
    return i === 0
         ? <div>{listContainer(listName)}</div>
         : <div><div style={{height: "10px"}}></div>{listContainer(listName)}</div>
  }

  return (
    <SimpleBarReact style={props.style.listContainer}>
        {props.listToRender.map((listName, i) => (
            <div key={`ListContainer${i}`}>
              {renderListContainer(listName, i)}
            </div>
          ))
        }
    </SimpleBarReact>
  )
}
